import React from "react";
import Navigation from './Navigation/Navigation';

const Contact = () => {
  return (
    <div>
      <Navigation />
      <h1>Book an Appointment</h1>
      <h2>Coming Soon</h2>
      <h3>However, until then, you can book an appointment by contacting me on 07951476008</h3>
    </div>
  );
};

export default Contact;
